    return (
        <React.Fragment>
          <div className="col-10 max-auto col-md-6 col-lg-4 my-3">
            <div className="card">
              <img src={image_url} alt="" />
            </div>

          </div>
        </React.Fragment>
      );
  }
}
export default Recipe;
